import photosGym from './photosGymList'
import styles from './photoSlider.module.css'

const PhotoGym = () => {
  return (
    <div className={styles.sliderImg}>
      {photosGym.map((img, index) => {
        return (
          <div key={index}>
            <img src={img} alt={'photo of GYM ' + index} />
          </div>
        )
      })}
    </div>
  )
}

export default PhotoGym
